data.definitie:
Incepand cu 1 martie 2002 a intrat in vigoare Legea nr. 76/2002 privind sistemul asigurarilor pentru somaj si stimularea ocuparii fortei de munca. In sensul prevederilor noii legi, somer inregistrat este persoana care indeplineste cumulativ urmatoarele conditii:
a) este in cautarea unui loc de munca de la varsta de minimum 16 ani si pana la indeplinirea conditiilor de pensionare;
b) starea de sanatate si capacitatile fizice si psihice o fac apta pentru prestarea unei munci;
c) nu are loc de munca, nu realizeaza venituri sau realizeaza din activitati autorizate potrivit legii, venituri mai mici decat valoarea indicatorului social de referinta al asigurarilor pentru somaj si stimularii ocuparii fortei de munca, in vigoare;
d) este disponibila sa inceapa lucrul in perioada imediat urmatoare daca s-ar gasi un loc de munca;
e) este inregistrata la Agentia Nationala pentru Ocuparea Fortei de Munca.
Persoanele inregistrate ca someri la agentiile pentru ocuparea fortei de munca si care se incadreaza in munca, potrivit legii, intr-o localitate situata la o distanta mai mare de 15 km de localitatea in care isi au domiciliul sau resedinsa, pot beneficia de o prima de incadrare, neimpozabila pe o perioada de 12 luni. Persoanele inregistrate ca someri la agentiile pentru ocuparea fortei de munca care se incadreaza in munca, potrivit legii, intr-o alta localitate situata la o distanta mai mare de 50 km fata de localitatea in care isi au domiciliul sau resedinta si, ca urmare a acestui fapt, isi schimba domiciliul ori isi stabilesc resedinta in localitatea respectiva sau in localitatile invecinate acesteia pot beneficia de o prima de instalare, neimpozabila in cuantum diferentiat.
Asimilatii somerilor sunt:
- absolventii institutiilor de invatamant si absolventii scolilor speciale pentru persoane cu handicap, in varsta de minim 16 ani, care, intr-o perioada de 60 de zile de la absolvire, nu au reusit sa se incadreze in munca potrivit pregatirii profesionale.
Tanar cu risc de marginalizare sociala este persoana cu varsta cuprinsa intre 16-26 ani,care indeplineste conditiile prevazute la calitatea de somer, se inregistreaza la agentia pentru ocuparea fortei de munca in a carei raza teritoriala isi are domiciliu sau,dupa caz, resedinta si se incadreaza in una dintre urmatoarele categorii:
a) se afla in sistemul de protectie a copilului sau provine din acest sistem;
b) are dizabilitati;
c) nu are familie sau a carui familie nu ii poate asigura intretinerea;
d) are copii in intretinere;
e) a executat una sau mai multe pedepse privative de libertate;
f) este victima a traficului de persoane.
Agentia pentru ocuparea fortei de munca incheie un contract de solidaritate cu tanarul cu risc de marginalizare sociala pe o durata de pana la 3 ani, dar nu mai putin de un an, in conditiile in care, la data incheierii contractului de solidaritate, tanarul nu a implinit varsta de 26 ani.
Tanar NEET - tanar cu varsta cuprinsa intre 16 si 24 de ani care nu are loc de munca, nu urmeaza o forma de invatamant si nu participa la activitati de formare profesionala.

